window.bookSummaryJSON = "<p><b>When three gorgeous chefs decide they want to expand their restaurant right into my boutique next door, things start to heat up. </b><br> <b>In more ways than one.</b><br> <br> With big dreams and bigger egos, three sinfully handsome restaurant owners are out to grow their culinary empire.<br> Problem is, my little pet store is right in their way.<br> But I’m not going down without a fight.<br> I don't care how hot they are.<br> Or how they look at me with hungry eyes.<br> <br> As I prepare to tell them where to shove their snail caviar, I realize have two options.<br> Kiss my pet paradise goodbye…<br> Or jump into the boiling water with these insufferable heartthrobs.<br> <br> I find that love and war simmer at the same steamy temperatures.<br> The question is, can this girl stand the heat without getting singed?</p> <p><i>This slow-burn why choose romance features a plucky main character with multiple love interests. If you like to indulge your secret bad-girl side, this is the book for you.</i></p>"; 
